        public static FunnySong[] GenerateXFunnySongsFromJSON(string givenJson, int DesiredFunnySongs )
        {
            return (FunnySong[])(from z in GenerateFunnySongsFromJSON(givenJson) orderby z.RndVal select z).Take(DesiredFunnySongs).ToArray();
        }

        public static  FunnySong[] GenerateFunnySongsFromJSON(string givenJson)
        {
            List<FunnySong> result = JsonSerializer.Deserialize<List<FunnySong>>(givenJson);
            var xRnd = new Random();
            foreach (var nn in result)
            {
                nn.RndVal = xRnd.Next(result.Count);
                //nn.ImportedOn = $"{DateTime.Now}-{xRnd.Next(result.Count)}"; //.ToString();                
                nn.ImportedOn = $"{DateTime.Now}-{nn.RndVal}"; 
            }
            return result.ToArray();
        }

        public static FunnySong[] GetFunnySongByID(int givenID)
        {
            var kludge = new List<FunnySong>();
            var result = GenerateFunnySongsFromJSON(FunnySongsSON).FirstOrDefault(f => f.Id == givenID);
            kludge.Add(result);
            return kludge.ToArray(); // result;
        }
    }

